import React, { useEffect, useState } from 'react';
import API from './api';
import TransactionForm from './components/TransactionForm';
import TransactionList from './components/TransactionList';

export default function App() {
  const [transactions, setTransactions] = useState([]);
  const [summary, setSummary] = useState({ income: 0, expenses: 0, balance: 0 });

  const fetchAll = async () => {
    try {
      const [tRes, sRes] = await Promise.all([
        API.get('/transactions'),
        API.get('/summary')
      ]);
      setTransactions(tRes.data);
      setSummary(sRes.data);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => { fetchAll(); }, []);

  const addTransaction = async (data) => {
    try {
      await API.post('/transactions', data);
      await fetchAll();
    } catch (err) { console.error(err); }
  };

  const updateTransaction = async (id, data) => {
    try {
      await API.put('/transactions/' + id, data);
      await fetchAll();
    } catch (err) { console.error(err); }
  };

  const deleteTransaction = async (id) => {
    try {
      await API.delete('/transactions/' + id);
      await fetchAll();
    } catch (err) { console.error(err); }
  };

  return (
    <div>
      {/* Navbar */}
      <nav className="navbar navbar-dark bg-primary mb-4">
        <div className="container-fluid">
          <span className="navbar-brand mb-0 h1">ðŸ’° Expense Tracker</span>
        </div>
      </nav>

      <div className="container-fluid">
        <div className="row">
          {/* Sidebar */}
          <div className="col-md-3 mb-4">
            <div className="card shadow-sm mb-3">
              <div className="card-body text-center">
                <h5 className="card-title">Summary</h5>
                <div className="d-flex justify-content-between mt-3">
                  <div className="text-success">
                    <h6>Income</h6>
                    <p className="fw-bold">pkr{summary.income.toFixed(2)}</p>
                  </div>
                  <div className="text-danger">
                    <h6>Expenses</h6>
                    <p className="fw-bold">pkr{summary.expenses.toFixed(2)}</p>
                  </div>
                </div>
                <hr />
                <h6>Balance</h6>
                <p className="fw-bold">{summary.balance >= 0 ? "pkr" + summary.balance.toFixed(2) : <span className="text-danger">pkr {summary.balance.toFixed(2)}</span>}</p>
              </div>
            </div>

            <div className="card shadow-sm">
              <div className="card-body">
                <h5 className="card-title">Add Transaction</h5>
                <TransactionForm onSave={addTransaction} />
              </div>
            </div>
          </div>

          {/* Main Content */}
          <div className="col-md-9">
            <div className="card shadow-sm">
              <div className="card-body">
                <h4 className="card-title mb-3">Transactions</h4>
                <TransactionList
                  transactions={transactions}
                  onDelete={deleteTransaction}
                  onUpdate={updateTransaction}
                />
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Footer */}
      <footer className="bg-light text-center py-3 mt-4 border-top">
        <small>Â© {new Date().getFullYear()} Expense Tracker | Built with React + Node.js</small>
      </footer>
    </div>
  );
}
